        <option :selected="checkSelected('fa-youtube-play')" v-bind:value="'fa-youtube-play'" :data-content="'<i class=\'fa fa-youtube-play\' aria-hidden=\'true\'></i>'"></option>
        <option :selected="checkSelected('fa-youtube-square')" v-bind:value="'fa-youtube-square'" :data-content="'<i class=\'fa fa-youtube-square\' aria-hidden=\'true\'></i>'"></option>
    </select>
</template>

<script>
    export default {
        name: "FontAwesome",
        data() {
            return {
                selectedOption: null
            }
        },
        props: {
            value: ''
        },
        mounted() {
            this.selectedOption = this.value;
            this.$jQUery('.selectpickericon').selectpicker('refresh');
        },
        methods: {
            checkSelected(val) {
                if (val === this.selectedOption)
                    this.$jQUery('.selectpickericon').selectpicker('refresh');
                return val === this.selectedOption ? 'selected' : '';
            }
        },
        watch: {
            value: function (newValue) {
                this.selectedOption = newValue;
            }
        }
    }
</script>
